(defn read-json-string [l start-pos]
  (case (get l start-pos)
    "COLLSCAN" "{\"COLLSCAN\":\"COLLSCAN\"}"
    "EOF"  "{\"EOF\":\"EOF\"}"
   
    (str-replace #"new\" \"Date" "new-Date"
      (let [end-pos (read-json-pos l start-pos)]
        (join " " (map #(case % 
                      ("{" "}" "}," ",") %
                      (->> (str "\"" % "\"")
                       (str-replace #"\"\""   "\"")
                       (str-replace #"_id"    "ID")
                       (str-replace #"\$"     "OP_")    
                       (str-replace #"\'"     "\\'")
                       (str-replace #"\("     "\\(")
                       (str-replace #"\"\[\"" "[")
                       (str-replace #"\"\]\"" "]")
                       (str-replace #"\)"     "\\)")
                       (str-replace #"\",\""  "\",")
                       (str-replace #",\""    "\",")
                       (str-replace #":\""    "\":" )))
                (->> l (take (+ 1 end-pos)) (drop start-pos))))
       ))))

