(defn find-query [l]
  (let [sl (read-json-string l 5)]
    (json/read-json (read-json-string l 5))))

(defn find-query-string [l]
  (str-replace "\"" "" (read-json-string l 5)))
    


(defn find-update [l]
  (let [sl (read-json-string l (+ 2 (read-json-pos l 5)))]
    (json/read-json sl)))

(defn epoch-second [t]
  (long (/ (c/to-long  t) 1000)))


(defn line-to-map [l]
  (let [t (split l #"\s")]
    (case (get t 2)
      "command"      
      {:ts    (get t 0)
       :epoch (epoch-second (get t 0))
       :conn  (get t 1)
       :op    (get t 2)
       :ns    (get t 3)
       :cmd   (get t 5)}
      
      "update"
      {:ts     (get t 0)
       :epoch  (epoch-second (get t 0))
       :conn   (get t 1)
       :op     (get t 2)
       :ns     (get t 3)
       :q      (find-query t)
       :q_string (find-query-string t)
       :q_norm (normalize-map (find-query t) true)
       :update (find-update t)
       :update_norm (normalize-map (find-update t) true)}

      "query"
      {:ts     (get t 0)
       :epoch  (epoch-second (get t 0))
       :conn   (get t 1)
       :op     (get t 2)
       :ns     (get t 3)
       :q_norm (normalize-map (find-query t) true)
       :q_string (find-query-string t)
       :q      (find-query t)}
     
      ("insert" "remove" "getmore")
      {:ts    (get t 0)
       :epoch (epoch-second (get t 0))
       :conn  (get t 1)
       :op    (get t 2)
       :ns    (get t 3)}
      
      ;; default is nothing
      nil)))
