(defn op-read
  [l]
  (case (:op l)
    "command" (:cmd l)
    "update" (str "update" (match [(:update l)]
                                  [{:OP_inc _}]  "-$inc"
                                  [{:OP_set _}]  "-$set"
                                  [{:OP_pull _}] "-$pull"
                             ))
    (:op l))) ;; end of op-read

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;log-analyzer/op-read</span>","value":"#'log-analyzer/op-read"}
